//Header.js
import React from "react";
import { Link } from "react-router-dom";
import plan from '../img/plan.png';


export default function Header() {
	return (
		<div>
			<header className="journal-header">
			<ol className="head-li">
				<li>
				<h1 className="title">My travel management</h1>
				</li>

				<Link to="/plan"><li className="options">
				<img src="plan" alt="planLogo" />
				Plan trip </li></Link>

				<Link to="/login"><li className="options"> log out</li></Link>
			</ol>

			</header>
		</div>
	);
}
